import React from 'react';
import {BrowserRouter, Route} from "react-router-dom";
import Header from "./components/Header";
import Footer from "./components/Footer";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
          <div style={{minHeight: "calc( 100vh - 78.4px)"}}>
              <Header></Header>
          </div>
          <Footer className="justify-content-center" style={{height: "78.4px"}}></Footer>
      </div>
    </BrowserRouter>
  );
}

export default App;
